import styled from "styled-components";

const CategorySection = styled.section`
    > ul {
      display: flex;
      flex-direction: row;
      background-color: rgb(254,251,240) ;
      margin-bottom: 5px;
      margin-top: 20px;
      height: 50px;
      >li{
        width: 50%;
        text-align: center;
        font: inherit;
        font-size: 24px;
        padding: 10px 0;
        border: 2px solid black;
        border-radius: 10px;
        margin-right: 20px;
        margin-left: 20px ;
        background-color: rgb(246,208,110);
        &.selected{
          background-color: rgb(246,209,180);
          border: 2px solid black;
        }
      }
    }
`

export {CategorySection};
